CREATE TABLE `cfg_box_config` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `box_key` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Chiave del box (es: lista_attesa, paziente, etc.)',
  `helper_name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Nome del helper da utilizzare',
  `title` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Titolo del box',
  `color` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT 'default' COMMENT 'Colore del box',
  `data_type` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT 'default' COMMENT 'Tipo di dati (default, paziente, etc.)',
  `data_params` text COLLATE utf8mb4_unicode_ci COMMENT 'Parametri JSON per i dati del box',
  `is_active` tinyint(1) DEFAULT '1' COMMENT 'Se il box è attivo',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `box_key` (`box_key`)
) ENGINE=InnoDB AUTO_INCREMENT=42 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
