CREATE TABLE `consolidamento_mensile` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `anno` int(4) NOT NULL COMMENT 'Anno del consolidamento',
  `mese` int(2) NOT NULL COMMENT 'Mese del consolidamento (1-12)',
  `utente_richiedente_id` int(11) NOT NULL COMMENT 'ID dell''utente che ha richiesto il consolidamento',
  `stato` enum('richiesto','consolidato','sbloccato') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'richiesto' COMMENT 'Stato del consolidamento',
  `note` text COLLATE utf8mb4_unicode_ci COMMENT 'Note aggiuntive alla richiesta',
  `data_richiesta` datetime NOT NULL COMMENT 'Data e ora della richiesta',
  `data_consolidamento` datetime DEFAULT NULL COMMENT 'Data e ora del consolidamento',
  `utente_consolidatore_id` int(11) DEFAULT NULL COMMENT 'ID dell''utente che ha consolidato il mese',
  `data_sblocco` datetime DEFAULT NULL COMMENT 'Data e ora dello sblocco',
  `utente_sbloccatore_id` int(11) DEFAULT NULL COMMENT 'ID dell''utente che ha rimosso il blocco',
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_anno_mese` (`anno`,`mese`),
  KEY `idx_stato` (`stato`),
  KEY `idx_utente_richiedente` (`utente_richiedente_id`),
  KEY `idx_utente_consolidatore` (`utente_consolidatore_id`),
  KEY `idx_data_richiesta` (`data_richiesta`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Tabella per gestire il consolidamento mensile';
